webpackJsonp([0x75d2eb65fa00],{6054:function(a,t){a.exports={data:{post:{html:'<p>With all the fuss yesterday about <a title="\'Salam Pax\' plays Americans for fools in Iraq - Ottawa Citizen - canada.com network" href="http://canada.com/ottawa/ottawacitizen/columnists/story.asp?id=5DF6ADB0-BF3C-46B0-B397-813A7E7CDBFD">Salam Pax being a Baathist stooge</a>, I\'m surprised noone noted the report from <a title="Salam Pax im Interview - Industrial Technology & Witchcraft - das Weblog von TextLab" href="http://www.industrial-technology-and-witchcraft.de/index.php?id=P2048">Industrial Technology & Witchcraft</a> that an email interview  with Mr. Pax <a title="VERFLIXT UND ZUGENEWST !" href="http://godany.blogspot.com/2003_05_01_godany_archive.html#105290098812282414">will appear Friday</a> in the Austrian magazin \'Formil\' (er, I mean <a href="http://www.format.at/">Format</a>). But since those posts were in German, it must be that language barrier thing. </p>\n<p><b>Update</b>: Jacqueline Godany has now posted an <a title="VERFLIXT UND ZUGENEWST !" href="http://godany.blogspot.com/2003_05_01_godany_archive.html#105299734132849615">authorized excerpt </a> (in German) of the interview. <b>And</b> Jeff Jarvis has <a title="BuzzMachine... by Jeff Jarvis" href="http://www.buzzmachine.com/archives/2003_05.html#003794">translated into English</a>.</p>',fields:{title:"Salam Pax Interview In Austria",date:"15 May 2003",url:"https://papascott.de/2003-05-15-salam-pax-interview-in-austria/"}}},pathContext:{slug:"/2003-05-15-salam-pax-interview-in-austria/",prev:{fields:{title:"German GDP down 0.2% in Q1 2003",date:"15 May 2003",slug:"/2003-05-15-german-gdp-down-02-in-q1-2003/"}},next:{fields:{title:"Traumwind will be an LP",date:"15 May 2003",slug:"/2003-05-15-traumwind-will-be-an-lp/"}}}}}});
